import "./Expenses.css";
import ExpensesItem from "./ExpensesItem";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpensesItem date={props.date} price={props.price} title={props.title} />
      <ExpensesItem date={props.date} price={props.price} title={props.title} />
      <ExpensesItem date={props.date} price={props.price} title={props.title} />
      <ExpensesItem date={props.date} price={props.price} title={props.title} />
    </div>
  );
}

export default Expenses;
